import React, {Component} from 'react';
import './Chatbox.css';

class Chatbox extends Component {
    constructor(props){
        super(props)
        this.state = {
            page: "Sex"
        };
    }
    render() {
        return (
            <div className='Chatbox'>
                <h1 className='Chatbox-Title'>Chatbox</h1>
                <div className='Chatbox-Content'>
                    <h2 className='Chatbox-Question'>{this.state.Question}</h2>
                </div>
            </div>
        );
    }
}

export default Chatbox;
